(3, '§ 1 Биология — наука о живом мире', 'Биология — наука, которая изучает живой мир нашей планеты. Название этой\r\nнауки произошло от двух греческих слов: bios — «жизнь»; logos — «учение».\r\nПоэтому биологию называют наукой о живом мире.\r\nБиология изучает разнообразие, строение и функции живых существ и\r\nприродных сообществ, распространение, происхождение и развитие организмов, их\r\nсвязи друг с другом и с неживой природой.\r\nИсследование природы началось на самых ранних этапах развития человечества\r\n— оно обеспечивало людям выживание. Им необходимо было знать, какие\r\nрастения, животные, грибы опасны или ядовиты, а какие могут быть использованы в\r\nпищу, чем лечиться, из чего изготовлять одежду, охотничьи приспособления, орудия\r\nтруда, из чего лучше строить жилье. Эти знания люди запоминали, передавали из\r\nпоколения в поколение, позднее начали составлять списки полезных растений и\r\nживотных, характеризовать их свойства, указывать места обитания, особенности\r\nиспользования, способы выращивания — культивирования.\r\nИз литературных памятников египтян, вавилонян, евреев, индийцев, китайцев известно, что уже в\r\nдревние времена люди многое знали о строении растений и животных, применяли эти знания в медицине и\r\nсельском хозяйстве. Например, на клинописных табличках (XIV в до н э), найденных в Месопотамии,\r\nесть сведения о различных растениях и животных, о делении животных на плотоядных и травоядных, а\r\nрастений — на деревья, овощи и лекарственные травы. В древнеиндийских памятниках «Махабхарата» и\r\n«Рамаяна» (VI-II вв до н э) говорится о повадках и образе жизни более 50 видов животных и о свойствах\r\nмногих растений. В рукописных книгах Вавилонии есть описания способов обработки земли, указывается\r\nвремя посева различных культурных растений, перечисляются животные — вредители урожая.\r\nПервой биологической энциклопедией можно считать 37-томный труд римского писателя и\r\nученого Плиния Старшего (I в н э) «Естественная история». Кроме знаний по искусству, истории и быту\r\nДревнего Рима в этой работе изложены многочисленные сведения о растениях, животных (культурных и\r\nдиких).\r\nВ работе Плиния Старшего и в последующих трудах по естественной истории помимо достоверных\r\nсведений о растениях и животных содержалось много вымышленных, поскольку методы биологических\r\nисследований были еще несовершенны и сводились в основном к описанию и систематизации\r\nнаблюдаемых природных явлений. Естественной историей с того времени вплоть до XIX в. стала\r\nименоваться область знаний о живой природе.\r\nТермин «биология» впервые был употреблен в 1779 г. немецким профессором\r\nанатомии Т. Рузом. В 1802 г. французский натуралист Ж.Б. Ламарк предложил\r\nиспользовать этот термин для обозначения науки, изучающей живые организмы.\r\nБиология, в отличие от естественной истории, наряду с описанием и\r\nсистематизацией широко использует аналитические и сравнительные, исторические,\r\nэкспериментальные (в том числе моделирование) методы исследования и применяет\r\nих в комплексе. Благодаря этому она открывает закономерности проявлений жизни и\r\nее развития, устанавливает принципы систематизации живых существ, особенности\r\nсуществования и взаимодействия организмов и их сообществ (живых систем) в\r\nизменяющихся условиях окружающей среды. Вот почему добытые биологией знания\r\nжизненно важны для каждого человека. Биология относится к фундаментальным\r\nнаукам, так как ее выводы имеют основополагающее теоретическое и прикладное\r\n(практическое) значение.\r\nСовременная биология представляет собой комплексную науку, состоящую из\r\nряда самостоятельных научных дисциплин со своими объектами исследования. Так,\r\nрастения изучает ботаника, животных — зоология, анатомо-физиологические\r\nсвойства человека — биология человека, бактерий — микробиология и т. д.\r\nДля современной биологии характерно глубокое\r\nвзаимопроникновение идей и методов биологических и\r\nдругих наук. Наиболее тесно биология связана с\r\nпотребностями человека в пищевых продуктах и\r\nлекарствах, в безопасной для жизни среде (сельское\r\nхозяйство, охрана природы, медицина). Обогащение\r\nбиологии идеями и методами других наук, открытия в\r\nразличных областях человеческой деятельности, новые\r\nвызовы и проблемы жизни и особенно практические\r\nзапросы людей определяют направления дальнейшего\r\nразвития биологических наук. Так, изучение\r\nмолекулярного строения единиц наследственности —\r\nгенов лежит в основе создания генной инженерии,\r\nпозволяющей получать организмы с признаками,\r\nнужными человеку. Достижения биотехнологии\r\nпозволяют получать промышленным путем\r\nнеобходимые для человека вещества (в том числе\r\nантибиотики, витамины).\r\nЗнание биологии очень важно для решения проблем сохранения окружающей\r\nсреды, сохранения биологического разнообразия, улучшения здоровья людей,\r\nсбережения природных ресурсов и обеспечения устойчивого развития природы и\r\nобщества.\r\nНаступило время, когда от каждого из нас зависит будущее нашей планеты.\r\nПоэтому современный человек не может считать себя образованным, если он не\r\nзнаком с основами биологических знаний.\r\nНаиболее общие закономерности, присущие живой природе, рассматриваются\r\nв курсе общей биологии, куда обычно включают биохимию, цитологию, генетику,\r\nбиологию развития, эволюционное учение и экологию. К изучению этих областей\r\nзнаний вы и приступаете.', '1. Объясните, почему биология, будучи одной из древнейших наук,\r\nнеобходима современному человеку.\r\n2. Докажите, что биология — фундаментальная наука.\r\n3. Поясните, что вы будете изучать в курсе «Основы общей биологии».', 0, 1, '2018-09-09 01:42:54', '2018-09-13 21:44:11'),
(4, 'ПРЕДВАРИТЕЛЬНЫЕ ЗАМЕЧАНИЯ', 'Анатомия человека — наука о внешней форме и внутреннем строении\r\nорганизма. Она изучает строение человеческого тела в связи с\r\nфункцией его органов, особенностями происхождения человека и его\r\nвозрастного развития, условиями труда и быта. Это касается как всего\r\nорганизма человека в целом, так и отдельных его систем и органов.\r\nВвиду того что изучение тела человека в анатомии всегда ведется с\r\nучетом выполняемой им и его отдельными органами функций, наименование\r\n«функциональная анатомия» в наибольшей мере соответствует\r\nсодержанию современной анатомии человека. Лишь будучи\r\nсвязаны с жизнедеятельностью организма, с функцией, те или иные\r\nанатомические данные становятся полноценными и представляют\r\nинтерес для специалиста в области физического воспитания.\r\nСлою «анатомия» означает расчленение, рассечение и происходит\r\nот греческого слова «anatemno» — «рассекаю». Таким образом, название\r\nэтой науки произошло от наименования одного из ее методов\r\nисследования. В течение долгого времени метод рассечения являлся\r\nединственным для изучения строения тела человека. Он широко используется\r\nи в настоящее время. Наряду с этим методом современная\r\nанатомия располагает многими другими методами исследования.\r\nПоэтому само название науки «анатомия» — «рассечение» теперь может\r\nбыть принято в расширенном толковании слова, а именно: рассечение\r\nвозможно не только ножом или лучом (например, рентгеновскими\r\nлучами), но и мыслью. Это подтверждается выражением:\r\n«Рассекая ножом, рассекайте мыслью» (П. И. Дьяконов).', '1. Наименование.\r\n2. Автор.\r\n3. Выходные данные(год, издательство).\r\n4. Основное содержание.\r\n5. Фактографические данные.\r\n6. Новизна материала, спорные моменты, критика.\r\n7. Возможность использования материала в практической работе.', 0, 1, '2018-09-13 21:53:58', '2018-09-13 21:53:58'),
(5, 'Задачи анатомии и ее связи с другими науками', 'Изучение анатомии\r\nнаправлено на решение многих задач, среди которых следует выделить\r\nвоспитание материалистического мировоззрения, подготовку к\r\nвосприятию других медико-биологических наук (физиологии, медицины),\r\nовладение знаниями, навыками и умениями, необходимыми\r\nв профессиональной деятельности. Анатомия, как предмет научного\r\nисследования, выясняет особенности строения организма на\r\nразных уровнях организации живой материи — от изучения тела в\r\nПРЕДВАРИТЕЛЬНЫ Е ЗАМЕЧАНИ Я\r\nцелом до раскрытия закономерностей строения клетки и ее составных\r\nчастей.\r\nИнтересы анатомии соприкасаются с вопросами, решаемыми\r\nдругими науками, в первую очередь физиологией, генетикой и антропологией.\r\nКраеугольное положение материалистической диалектики\r\nо единстве структуры и функции раскрывается в исследовании\r\nкак структур (анатомами), так и функций (физиологами). Генетика,\r\nизучая наследственность человека, раскрывает законы роста и развития,\r\nопределяемые наследственностью и влиянием внешней среды.\r\nХотя интересы антропологии направлены на изучение многообразия\r\nпроявлений не только структур, но и функций организма, традиционно\r\nпервые остаются для нее основным источником информации\r\nкак о современных, так и об ископаемых людях. Пограничный раздел\r\nанатомии и антропологии, выясняющий формы изменчивости\r\nструктур тела человека и определяющие ее факторы, называется анатомической\r\nантропологией.', NULL, 0, 1, '2018-09-13 21:56:51', '2018-09-13 21:56:51'),
(6, 'Методологические основы анатомии.', 'Анатомия человека принадлежит\r\nк биологическим наукам, то есть к наукам, изучающим жизнь,\r\nжизненные процессы организмов (bios—жизнь). Как биологическая\r\nнаука она использует для объяснения наблюдаемых явлений, для построения\r\nгипотез и теорий, для обобщения фактического материала\r\nзаконы развития и законы жизни, присущие всем живым организмам.\r\nСреди всех живых существ человек наиболее сложное существо.\r\nПринципиальное отличие его составляют не физические особенности\r\nстроения, а причины этих особенностей: социальный характер\r\nжизни, труд и членораздельная речь. Такие биологические явления,\r\nкак естественный отбор, борьба за существование, в процессе становления\r\nчеловека занимали все более и более подчиненное место по\r\nсравнению со складывающимися между людьми производственными\r\nотношениями. От условий труда, от производственных отношений\r\nзависят условия жизни, физическая природа человека, особенности\r\nстроения и функций его организма. Поскольку условия труда\r\nопределяются социальными законами, последние имеют первенствующее\r\nзначение для человека.\r\nЕстественно, что социальные и биологические факторы, обусловливающие\r\nособенности эволюции физических, материальных\r\nсвойств человеческого организма, неразрывно связаны между собой,\r\nпричем законы общественной жизни не уничтожают биологические\r\nзаконы. Основные жизненные процессы (обмен веществ, рост, размножение,\r\nдвижение, способность воспринимать раздражения и реагировать\r\nна них), протекающие во всяком живом существе, имеютместо и в человеческом организме, что позволяет использовать биологические\r\nзаконы при изучении человеческого тела.\r\nК.А. Тимирязев писал, что «каждая органическая форма есть результат\r\nвоздействия на нее не только современных ей условий, но и\r\nвсех неисчислимых условий, действовавших на несметные ряды\r\nформ, из которых она произошла». Это обстоятельство позволяет\r\nрассматривать каждую форму «как процесс, как нечто не просто от\r\nвека существующее, а непрерывно образующееся»1\r\n. Поэтому при\r\nизучении анатомии человека для понимания формы и строения его\r\nтела используются факты, касающиеся процесса развития вида —его\r\nфилогенеза (phylon —род, genesis —происхождение), а также развития\r\nотдельного человека, начиная от зарождения и кончая смертью,\r\n—его онтогенеза (ontos —сущий, genesis —происхождение). Для этого\r\nпонимания анатомия человека учитывает данные смежных наук,\r\nглавным образом сравнительной анатомии и эмбриологии (embryo —\r\nзародыш, logos —наука). Изучая анатомию животных с помощью метода\r\nих сравнения и развитие человеческого эмбриона, можно понять\r\nтот путь, по которому идет формирование того или иного органа\r\nи всего организма в целом.\r\nЧеловеческий организм представляет собой единое целое, в котором\r\nвсе отдельные системы и органы развиваются и функционируют во взаимной\r\nзависимости и обусловленности. В качестве примера сложной\r\nвзаимосвязи органов живого человеческого тела можно привести связь\r\nмежду двигательным аппаратом и нервной системой. Двигательный\r\nаппарат посылает раздражения в центральную нервную систему, а центральная\r\nнервная система регулирует работу двигательного аппарата.\r\nОднако во всяком взаимодействии необходимо выделить ведущее звено.\r\nЭтим звеном в человеческом организме, как и в организмах других\r\nживых существ, является нервная система, которая, с одной стороны,\r\nосуществляет связь организма с окружающей его внешней средой, с\r\nдругой, находясь в анатомической и функциональной связи со всеми\r\nсистемами, со всеми органами, со всеми тканями и клетками организма,\r\nобеспечивает его существование как единого целого.\r\nОсновой «мыслящей», «думающей» анатомии служит каузальный\r\nподход — выяснение причин и проявлений изменчивости организма\r\nв связи с функцией и другими факторами.', NULL, 0, 1, '2018-09-13 21:57:15', '2018-09-13 21:57:15'),
(7, 'Факторы изменчивости организма', 'Систематизируя все факторы,\r\nопределяющие физическую природу человека, и рассматривая их в\r\nпоследовательном порядке, надо отнести к ним в первую очередь все то, что связано с внутриутробным развитием организма. К этой группе\r\nфакторов причисляют те особенности, которые передаются человеку\r\nпо наследству и с которыми он рождается.\r\nК этим факторам принадлежит также возраст. Все органы человеческого\r\nтела—одни в большей, а другие в меньшей мере —подвержены\r\nвозрастным изменениям. При этом одни органы развиваются быстрее,\r\nчем другие, одни стареют раньше, адругае позднее. Возрастные изменения\r\nотличаются большой сложностью и далеко выходят за пределы\r\nобщего схематизированного описания строения человеческого тела.\r\nСледующим фактором является пол. Половые особенности в той\r\nили иной степени проявляются в строении всех органов, но в наибольшей\r\nмере они касаются органов малого таза.\r\nНаконец, к факторам изменчивости организма относятся социальные\r\nусловия жизни человека, условия его труда и быта. Болезнетворные\r\nпроцессы, если они имеют место, тоже влияют на анатомические\r\nособенности и на функцию того или иного органа. Таким образом,\r\nу каждого отдельного человека индивидуальные колебания в\r\nстроении его органов так же бесконечно разнообразны, как разнообразны\r\nкомбинации перечисленных основных факторов.\r\nДля специалистов по физической культуре и спорту особый интерес\r\nпредставляют те изменения в организме, те особенности формы,\r\nстроения и связанной с ними функции, которые происходят под влиянием\r\nзанятий физическими упражнениями и спортом.', NULL, 0, 1, '2018-09-13 21:57:37', '2018-09-13 21:57:37'),
(8, 'Методы исследования.', 'Анатомия применяет широкий арсенал методов\r\nисследования. Детали строения изучаются на мертвых объектах:\r\nтрупах, извлеченных из организма органах, кусочках органов или тканей,\r\nвзятых прижизненно в ходе биопсии (биоптатах крови, костного\r\nмозга, мышц и др.). При работе на трупе используются методы послойного\r\nрассечения тканей с последующей препаровкой (выделением)\r\nструктурных компонентов, подлежащих изучению. Для облегчения\r\nэтой работы и предохранения препарата от гниения его фиксируют\r\nспециальными растворами, чаще всего слабым раствором формалина.\r\nКровеносные и лимфатические сосуды, протоки желез хорошо выявляются\r\nпри их предварительном заполнении застывающими массами\r\n(метод инъекции). Можно удалить окружающие мягкие ткани, подвергнув\r\nпрепарат действию кислоты. Тогда остается слепок образований,\r\nзаполненных инъекционной массой (метод коррозии).\r\nИзучение анатомии живого человека требует использования относительно\r\nбезвредных методов исследования. С этой целью применяются\r\nрентгеновские лучи и ультразвук (методы рентгенографии и\r\nультразвуковой эхо-локации). При этом дифференцируются органы, обладающие различной пропускной способностью по отношению к\r\nданным физическим агентам. Началом рентгенологических исследований\r\nв анатомии послужило применение в 1895— 1896 гг. анатомами\r\nП.Ф. Лесгафтом и В.Н. Тонковым и физиком П.Н. Лебедевым (независимо\r\nдруг от друга) лучей Рентгена для выявления костей кисти.\r\nСегодня наряду с обычными приемами рентгенографии и рентгеноскопии\r\nсуществуют кинорентгенография, микрорентгенография,\r\nэлектрорентгенография, цветная рентгенография, ЭВМ-томография.\r\nБольшими перспективами обладает метод ядерно-магнитного резонанса,\r\nкоторый используется для изучения мягких тканей.\r\nК числу наиболее широко распространенных относятся методы антропометрии\r\nи антропоскопии, позволяющие определить общие (тотальные)\r\nи частные (парциальные) размерытела (продольные, поперечные,\r\nобхватные) и толщину кожно-жировых складок, оценить в условных\r\nединицах (баллах) выраженность признаков, не подлежащих метрическим\r\nизмерениям (например, вторичных половых признаков —\r\nразвитие волосяного покрова, форму и размеры молочной железы у девочек,\r\nформу гортани у мальчиков). Современная микроскопическая\r\nанатомия и гистология используют методы избирательного окрашивания\r\nотдельных структур, жиров, ферментов и т. п. на срезах тканей толщиной\r\nв несколько микронов с последующим изучением этих препаратов\r\nпод микроскопами, дающими увеличение объектов в сотни или тысячи\r\nраз. Наряду со световой микроскопией существует электронная,\r\nпозволяющая увеличить изображение в десятки и сотни тысяч раз. С ее\r\nпомощью изучается строение клетки и ее компонентов', NULL, 0, 1, '2018-09-13 21:57:57', '2018-09-13 21:57:57'),
(9, 'Классификация морфологических (анатомических) наук.', 'Все био логические\r\nнауки подразделяются на две основные группы—науки о форме и\r\nнауки о функции организма, или, как говорят, на морфологические и\r\nфизиологические науки (morphe—форма, physis—природа). Анатомия\r\nпо этой классификации относится к морфологическим наукам.\r\nМорфологические науки принято подразделять на науки, изучающие\r\nстроение организма невооруженным глазом (макроскопическая\r\nморфология: macros — большой, scopeo — смотрю), и науки, изучающие\r\nэто строение с помощью микроскопа (микроскопическая\r\nморфология: micros—малый). Анатомия является в основном макроскопической\r\nморфологией. Микроскопическая анатомия выделилась\r\nкак самостоятельная наука после изобретения и применения\r\nмикроскопа. К микроскопической морфологии относятся гистология\r\n— наука о тканях (histos —ткань) и цитология — наука о клетке\r\n(kytos —клетка). Помимо этого, существует раздел морфологии, изучающий\r\nобласть пограничного видения, —макромикроскопическая анатомия. Своим возникновением и развитием в нашей стране она\r\nобязана трудам В.П. Воробьева (1876—1937).\r\nТа основная наука, от которой отделились эти ветви, анатомия\r\nчеловека, получила название нормальной анатомии. Она изучает здорового\r\nживого человека, находящегося в своем естественном, нормальном\r\nсостоянии. В этом отношении она отличается от патологической\r\nанатомии, предметом изучения которой являются те изменения\r\nв строении организма, которые происходят под влиянием заболеваний\r\n(pathos — страдание). Нормальная анатомия также имеет ответвления.\r\nНекоторые из них рассматриваются как самостоятельные\r\nнауки. К этим наукам относятся в первую очередь пластическая анатомия\r\nи топографическая анатомия.\r\nПластическая анатомия (plastike — ваяние) изучает внешнюю\r\nформу человеческого тела и те особенности его внутреннего строения,\r\nкоторые ее обусловливают. Эта наука имеет прикладное значение\r\nдля изобразительных искусств (живописи, графики и скульптуры).\r\nПервым профессором пластической анатомии в нашей стране\r\nбыл И. В. Буяльский (1789-1866).\r\nТопографическая анатомия (topos — место, grapho — пишу) изучает\r\nвзаимное расположение органов. Она возникла как наука, необходимая\r\nдля целей практической медицины, в особенности для хирургии,\r\nприменительно к которой получила также название хирургической\r\nанатомии. Создателем топографической и хирургической анатомиибылН.И.Пирогов(1810-1881).\r\n\r\nК ответвлениям нормальной анатомии относятся также динамическая\r\nанатомия (морфология), спортивная морфология и возрастная\r\nанатомия. Динамическая анатомия (dynamikos —действующий)\r\nизучает спортивные, трудовые, художественные и другие движения\r\nчеловеческого тела. Анатомические изменения в организме, которые\r\nпроисходят при выполнении этих движений, причем не только адаптационные\r\n(приспособительные) изменения, но и результаты так называемого\r\nспортивного отбора (подробнее см. стр. 512) выясняет наряду\r\nс динамической анатомией (морфологией) спортивная морфология.\r\nОсновоположником изучения движений тела с позиций анатомии\r\nбыл в нашей стране П.Ф. Лесгафт (1837-1909). Возрастная\r\nанатомия изучает анатомические особенности человеческого организма\r\nс точки зрения его возрастных изменений. Большое значение\r\nдля создания этой отрасли анатомии в отечественной науке имели\r\nтруды Н.П. Гундобина(1860-1908).\r\nРазличают также типовую анатомию, проекционную анатомию,\r\nрентгеноанатомию и теоретическую анатомию. Типовая анатомия, основоположником которой является В.Н. Шевкуненко (1872—\r\n1952), изучает соотношение между внутренним строением тела и его\r\nвнешними формами. Все многообразие особенностей этого соотношения\r\nподразделяется на основные группы, или типы. Тем самым\r\nреализуется антропологический подход в анатомии, задача которого\r\n— исследование форм (типов) и факторов изменчивости организма.\r\nПредметом изучения в проекционной анатомии является проекция\r\nорганов человеческого тела на его наружную поверхность. Рентгеноанатомия\r\nизучает строение человеческого организма с помощью\r\nрентгеновских лучей. Успехи этой науки в нашей стране связаны с\r\nименами Д.Г. Рохлина и М.Г. Привеса. В конце прошлого столетия\r\nбыла создана теоретическая анатомия, изучающая общие закономерности\r\nстроения тела. Основоположником ее и автором наименования\r\nявляется П.Ф. Лесгафт.\r\nУглубление анатомических исследований привело в настоящее\r\nвремя к относительному обособлению ряда разделов анатомии.\r\nТрадиционны в нашей стране успехи в изучении анатомии лимфатической\r\nсистемы. Заслуга в этом принадлежит Г.М. Иосифову\r\n(1870-1933), ДА . Жданову (1908-1971), М.С. Спирову (1892—\r\n1973), Ю.И. Бородину, М.Р. Сапину и их ученикам. Внимание ученых\r\nпривлекает анатомия головного мозга и нервной системы. В\r\nэтой связи необходимо упомянуть В.А. Беца (1834—1894), В.М. Бехтерева(1857-1927),\r\nВ.П. Воробьева, В.Н. Терновского( 1888—1976).\r\nСущественный вклад советские анатомы внесли в изучение кровеносных\r\nсосудов, а также в выяснение путей микроциркуляции. Огромное\r\nзначение в этом отношении имеют работы В.Н. Тонкова\r\n(1872-1954), Б.А.Долго-Сабурова (1900-1960), В.В. Куприяноваи\r\nих учеников.\r\nНесомненны также успехи в разработке проблем возрастной и\r\nконституциональной морфологии. Ведущие позиции здесь принадлежат\r\nантропологам московской школы, которую долгие годы возглавлял\r\nВ.В. Бунак(1891-1979).\r\nДля специалиста в области физической культуры и спорта важно\r\nне только основное содержание анатомии человека, но и многое из\r\nтого, что относится к ее ответвлениям. Постоянно имея дело с живым\r\nчеловеком, преподаватель физической культуры, тренер или спортсмен\r\nрешают возникающие в процессе своей деятельности вопросы,\r\nсвязанные с особенностями строения и функций человеческого тела.\r\nДля них бывает важно значение и возрастных особенностей организма,\r\nи взаимного расположения и проекции органов, и внешних форм\r\nчеловеческого тела.', NULL, 0, 1, '2018-09-13 21:58:32', '2018-09-13 21:58:32'),
(10, 'Принципы изучения анатомии.', 'П.Ф. Лесгафт писал, что «при изучении\r\nанатомии главным объектом должен всегда быть живой организм,\r\nиз наблюдений над которым должно исходить всякое изучение,\r\nмертвый же препарат должен служить только проверкой и дополнением\r\nк изучаемому живому организму»2\r\n . Действительно, изучая\r\nанатомию, недостаточно пользоваться только препаратами, рисунками,\r\nатласами, книгами. Необходимо наблюдать, изучать живого\r\nчеловека. Для спортсмена такое изучение играет особенно важную\r\nроль. В своей практической деятельности он имеет дело всегда с живым\r\nчеловеком. Поэтому весь процесс изучения анатомии должен\r\nбыть направлен на познание живого человеческого тела. В первую\r\nочередь это касается двигательного аппарата. Рассматривая анатомический\r\nпрепарат, прежде всего необходимо ясно себе представить,\r\nгде данный орган находится у живого человека. Нужно научиться\r\nопределять на живом человеческом теле все наиболее выступающие\r\nкостные образования, щели крупных суставов, положение мышц и\r\nпонимать значение последних для рельефа наружной поверхности\r\nтела. Прощупывая поверхностные мышцы, необходимо научиться\r\nопределять их состояние. Изучая кровеносные сосуды, артерии и\r\nвены, нервы, следует находить их проекцию на наружную поверхность\r\nтела, определять по пульсации ход крупных артериальных\r\nстволов, знать просвечивающие сквозь толщу кожи вены. При изучении\r\nвнутренних органов, в частности легких, печени, желудка,\r\nкишок, сердца, важно ясно представлять себе их положение на живом\r\nчеловеке. То же самое касается головного и спинного мозга, проекции\r\nдолей полушарий мозга, мозжечка, продолговатого мозга и\r\nдругих крупных образований. Это относится и к некоторым образованиям\r\nорганов чувств (например, к полукружным каналам внутреннего\r\nуха). В результате систематически проведенного изучения\r\nанатомии на живом человеке можно в наибольшей мере достигнуть\r\nпонимания внутреннего строения организма по его внешней форме.', NULL, 0, 1, '2018-09-13 21:58:44', '2018-09-13 21:58:44'),
(11, 'Социальная значимость анатомии.', 'Ошибочны представления об\r\nанатомии как мертвой, застывшей в неизменном постоянстве науке.\r\nКонечно, состав скелета за весь период эволюции человека, насчитывающий\r\nнесколько миллионов лет, не изменился. Тем более он сохранил\r\nсвое постоянство у человека современного вида, пребывание которого\r\nна планете исчисляется тысячами лет. Однако размеры костей и\r\nдругих органов изменяются от поколения к поколению, что связано с неравномерностями роста и развития. На строении тела отражаются\r\nусловия жизни и профессиональные особенности трудовой деятельности,\r\nхарактер питания и уровень физической нагруженности. Не\r\nпоследнюю роль играют и занятия физической культурой и спортом.\r\nАнатом, как регистратор изменений, происходящих в организме человека\r\nпри неблагоприятных условиях труда и жизни, выполняет важные\r\nсоциальные функции. Запрету испытаний атомного оружия в атмосфере\r\nспособствовала широкая кампания, поднятая морфологами,\r\nдоказавшими опасность радиоактивного излучения для наследственности,\r\nвозникновения под его действием врожденных уродств, злокачественных\r\nновообразований и других видов патологии. Не последняя\r\nроль принадлежит морфологам в обосновании непоправимых последствии\r\nдля человечества при использовании химического оружия.\r\nТренер и педагог физического воспитания, наделенные знаниями\r\nанатомии и других медико-биологических дисциплин, должны\r\nстроить тренировочный процесс так, чтобы не только подвести\r\nспортсмена к достижению высокого результата, но и улучшить состояние\r\nего здоровья и физического развития. Завет великого врача\r\nДревней Греции Гиппократа (ок. 460—377 до н.э.) «не вреди» строго\r\nобязателен не только для медиков, дающих клятву Гиппократа при\r\nокончании высшего учебного заведения, но и для специалистов по\r\nфизическому воспитанию.', NULL, 0, 1, '2018-09-13 21:59:03', '2018-09-13 21:59:03'),
(12, 'ОСИ И ПЛОСКОСТИ ТЕЛА ЧЕЛОВЕКА, АСИММЕТРИЯ СТРОЕНИЯ', 'Частями тела человека являются туловище, шея, голова и две пары\r\nконечностей: две верхние конечности — руки и две нижние — ноги.\r\nВ анатомии условно принято изучать тело в вертикальном симметричном\r\nположении с опущенными руками, большие пальцы которых\r\nобращены кнаружи (положение супинации). При анатомическом\r\nописании пользуются плоскостями и направлениями, проходящими\r\nчерез тело соответственно трем плоскостям и осям системы\r\nпрямоугольных координат. Из трех плоскостей одна проходит горизонтально\r\nи называется горизонтальной, а две, идущие перпендикулярно\r\nк ней, являются вертикальными и называются одна — фронтальной,\r\nдругая — сагиттальной. Горизонтальная плоскость проходит\r\nпараллельно линии горизонта; фронтальная плоскость — в поперечном\r\nнаправлении, соответствуя плоскости лба, откуда произошло\r\nи ее название (frons — лоб, frontalis — лобный); сагиттальная плоскость\r\n— через тело в переднезаднем направлении (sagitta — стрела). Сагиттальная плоскость, проходящая строго посередине тела и делящая\r\nего на правую и левую половины, называется срединной или\r\nмедианной. Оси, идущие в местах пересечения горизонтальных и\r\nфронтальных плоскостей, называются поперечными; идущие в местах\r\nпересечения горизонтальных и сагиттальных плоскостей — сагиттальными\r\nили переднезадними; находящиеся на пересечении\r\nфронтальных и сагиттальных плоскостей — вертикальными. Естественно,\r\nчто фронтальных, горизонтальных и сагиттальных плоскостей\r\nможно провести через тело любое количество. Исключение составляет\r\nмедианная плоскость — ее можно провести только одну.\r\nФронтальная плоскость, проходящая через продольную ось тела,\r\nделит его на передний и задний отделы. Передний называется также\r\nбрюшным или вентральным (venter —живот), а задний — спинным\r\nили дорсальным (dorsum—спина). Поверхность какого-либо органа,\r\nобращенная в сторону передней поверхности тела, называется передней\r\nили вентральной, а направленная в сторону спины — задней или\r\nдорсальной. Поверхность органа, которая обращена в сторону срединной\r\nплоскости тела, называется внутренней или медиальной\r\n(medialis), а противоположная — наружной или латеральной\r\n(lateralis). Поверхность, обращенная в сторону головы, называется\r\nкраниальной (cranialis — черепной) или верхней, а противоположная\r\nповерхность, обращенная к тазу, — каудальной (caudalis — хвостовой)\r\nили нижней. Соответственно плоскостям и осям тела названы и направления,\r\nпо которым располагается тот или иной орган: кверху,\r\nили краниально, т. е. по направлению к голове; книзу, или каудально,\r\nт. е. по направлению к тазу; кпереди, или вентрально; кзади, или\r\nдорсально; кнутри, или медиально; кнаружи, или латерально. Термины\r\n«краниально» и «каудально» употребляют только тогда, когда\r\nречь идет о туловище и шее. Для конечности пользуются терминами,\r\nобозначающими более близкое или более отдаленное по отношению\r\nк туловищу положение ее части: соответственно проксимальное или\r\nдистальное. Для определения направления применяют термины\r\n«проксимально» и «дистально».\r\nДве половины тела, на которые разделяет его медианная плоскость,\r\nпостроены по типу их зеркального отображения. Однако в деталях\r\nони не вполне одинаковы. Асимметрия строения тела особенно\r\nсказывается на строении и положении его внутренних органов. Такие\r\nнепарные органы, как желудок, селезенка, сердце и другие,\r\nасимметричны как по своему строению, так и по местоположению в\r\nорганизме. Если говорить только о внешних формах тела, то они также\r\nне вполне симметричны. Например, у правшей обычно больше развита правая рука: она не только сильнее, но и длиннее, чем левая,\r\nприблизительно на сантиметр. У левшей имеются обратные соотношения.\r\nМожно также отметить некоторую асимметрию строения\r\nног. Позвоночный столб тоже построен не совсем симметрично и\r\nимеет небольшие изгибы в сторону. Почти у всех людей имеется некоторая\r\nасимметрия лица', NULL, 0, 1, '2018-09-13 22:00:31', '2018-09-13 22:00:31'),
(13, 'ОРГАНЫ, СИСТЕМЫ И АППАРАТЫ ОРГАНОВ', 'При изучении человеческого тела его принято подразделять на\r\nсистемы и аппараты органов и рассматривать их в определенной последовательности.\r\nПоэтому нормальную анатомию человека иногда\r\nназывают систематической анатомией.\r\nОрган, как компонент системы или аппарата органов, анатомически\r\nи функционально обособлен от соседних образований. Органом\r\nназывают часть тела, которая в процессе развития вида и особи\r\nприобрела своеобразие положения, формы, размеров, внутреннего\r\nстроения, функций и взаимодействует с другими органами. Орган —\r\nэто целостная конструкция, состоящая из различных тканей (см. стр.\r\n22) и подразделяющаяся на более мелкие части: доли, дольки, сегменты\r\nи т. п. Эти анатомические образования, в свою очередь, включают\r\nв себя структурно-функциональные единицы органа. При выделении\r\nанатомических систем и аппаратов учитывают общность источников\r\nразвития и функциональных отправлений органов. Органы,\r\nвыполняющие общие функции и имеющие общие источники\r\nпроисхождения, образуют анатомическую систему (например, костную,\r\nмышечную, пищеварительную, дыхательную). Для аппаратов\r\nхарактерно функциональное объединение систем и органов, имеющих\r\nразличные источники происхождения (опорно-двигательный,\r\nэндокринный).\r\nДля динамической анатомии и спортивной морфологии характерно\r\nподразделение целостного организма на три части (блока):\r\nорганы, исполняющие движения (опорно-двигательный аппарат);\r\nорганы, регулирующие двигательную деятельность (нервная система,\r\nорганы чувств, эндокринный аппарат); органы, обеспечивающие\r\nдвигательную деятельность (сердечно-сосудистая, пищеварительная,\r\nдыхательная, выделительная системы). Это разграничение\r\nусловно, так как достижение высокой спортивной формы, приспособление\r\nк специализированным нагрузкам достигается благодаря\r\nперестройке всего организма, а не какой-либо отдельной его части\r\n(блока).', NULL, 0, 1, '2018-09-13 22:00:49', '2018-09-13 22:00:49');
